import React from 'react'
import {NavLink} from 'react-router-dom'

export default function NavBar() {
    return (
        <nav>
            <ul>

                <li><NavLink to="/api/contact" activeStyle={{
                    color : "blue",
                    fontWeight : "bold",
                    backgroundColor : "blue"
                }} exact>Add Feedback</NavLink></li>
                <li><NavLink to="/api/logout" activeStyle={{
                    color : "blue",
                    fontWeight : "bold"
                }} exact>Logout</NavLink></li>
            </ul>
        </nav>
    )
}
